import React, { useEffect } from 'react'
import { useDispatch } from 'react-redux'
import { dashboardManager } from '../redux/slices/managerSlices'

const Home = () => {
    const dispatch=useDispatch();
    useEffect(()=>{
   dispatch(dashboardManager);
    },[dispatch])
  return (
    <div>Homeasasa</div>
  )
}

export default Home
